import React from 'react';
import PropTypes from 'prop-types';

export default function Navbar(props) {
  return (
    <>
<nav class="navbar navbar-expand-lg  ">
  <a class="btn colorw" href="#">Navbar</a>
 
       
          
        
        <div className="collapse navbar-collapse" id="navbarNavDropdown">
          <ul className="navbar-nav">
            
            <li className="nav-item">
              <a id='item1' className="btn btn-border" href="/ShowAndBook"><button className='btn colorw' >{props.navbar_item1}</button></a>
            </li>
            <li className="nav-item">
              <a id='item2' className="btn btn-border" href="/Create"><button className='btn colorw' >{props.navbar_item2}</button></a>
            </li>
            <li className="nav-item">
              <a id='item3' className="btn btn-border" href="/ShowAndId" ><button className='btn colorw' >{props.navbar_item3}</button></a>
            </li>
            <li className="nav-item">
              <a id='item4' className="btn btn-border" ta href="https://www.netmeds.com/"><button className='btn colorw' >{props.navbar_item4}</button></a>
            </li>
            <li className="nav-item">
              <a id='item4' className="btn btn-border" href="https://www.uber.com/in/en/ride/"><button className='btn colorw' >{props.navbar_item5}</button></a>
            </li>
          </ul>

        </div>
      </nav>

    
    </>


  );
}

Navbar.propTypes = {
  title: PropTypes.string.isRequired,
  about: PropTypes.string.isRequired,
};

Navbar.defaultProps = {
  title: 'set title here',
  about: 'About ',
};
